      content: >2

        **ДОГОВОР ЗАЙМА №74-102**  

        Дата: 22/10/2274  


        Между сторонами:  

        1. Виктор Малькор (кредитор)  

        2. Караван "Синяя Линия" (должник - капитан Миллер)


        Условия:  

        - Сумма: 1,200 крышек  

        - Срок: до 15/01/2275  

        - Процент: 30% ежемесячно  

        - Залог: 3 брамина + партия оружия  


        Особые пункты:  

        1. При просрочке - право на 50% будущей добычи каравана 

        2. В случае смерти капитана - долг переходит на всех членов каравана "Синяя Линия"  

        3. Споры решаются "старым способом" (см. Приложение 1) 


        Примечания архивариуса:  

        - Капитан Миллер пропал 12/01/2275 (тело не найдено)  

        - Брамины возвращены с странными шрамами  

        - На обороте документа пятно, похожее на слезу  
