      content: "[head=3]РАСПОРЯЖЕНИЕ №2274-47-Г [head/]\nАрхив Баззара  \r\nДата: 15/12/2274  \r\n\r\nТема: Регулирование торговли довоенными артефактами  \r\n\r\n1. Новые правила приема:  \r\n- Все электронные устройства с маркировкой довоенных годов (особенно 2047-2077) подлежат обязательной проверке в \"Малькор-Терминал\"  \r\n- За сдачу рабочих приборов: вознаграждение 25-50 крышек  \r\n\r\n2. Меры безопасности:  \r\n- Запрещено приносить на рынок:  \r\n* Излучающие устройства без свинцовой защиты  \r\n* Предметы с признаками радиационного заражения  \r\n\nНарушители штрафуются на 20 крышек  \r\n\r\n3. Зоны ограниченного доступа:  \r\n- Радиостанция  \r\n- Промзона у кратера  \r\n- Радиоактивное озеро  \r  \r\n\r\n4. Для торговцев:  \r\n- Про особо ценные находки докладывать управляющему  \r\n- Подозрительные предметы (излучающие шум/тепло) немедленно сдавать охране  \r"
