      content: "\"Журнал учета поставок\"  \r\nДата: 08/11/2273  \r\n\r\nПоставщик: Караван \"Синяя Линия\"  \r\nПринял: Старый Морт  \r\n\r\nТовары:\n  \r\n- 3 ящика довоенных консерв (маркировка стерта)  \r\n- 1 бочка \"очищенной\" воды (радиация 3 рад/с)  \r\n- 5 газовых баллонов (2 протекают)  \r\n- 1 коробка с надписью \"Не вскрывать\" (вскрыта, пусто)  \r\n\r\nОсобые отметки:\n\n- Караванный мастер Том пропал по пути (оставил только шляпу с дыркой от лазера)  \n\nМорт, если читаешь - бочки с водой больше не принимать. Уже трое покупателей светятся в темноте."
