      content: >
        Ну разве я плохой?  


        Все твердят: "Малькор - жадный, Малькор - жестокий".  


        Но кто:  

        - Построил новый медпункт, когда мэр бездействовал?  

        - Охраняет караваны бесплатно (если, конечно, товар не "случайно" теряется)?  

        - Даёт работу каждому второму в этом проклятом городе?  


        Да, я требую лояльности. Да, мои методы... жёсткие.  


        Но в Пустошах добрые дохнут первыми.  


        P.S. Если читаешь это - поздравляю. Ты нашёл мою "исповедь". Теперь иди и посмотри, сколько крышек ты мне должен.  



        [italic]Босс оставляет эти записки по всему архиву. Вчера нашёл одну в ящике с патронами - там было добавлено: "Особо умные кончают как старый Джек. Помнишь Джекa, да?" [/italic]
