      content: "[head=3]ОФИЦИАЛЬНОЕ УВЕДОМЛЕНИЕ №2275-03 [head/] \r\nУправление Баззара Уэндовера  \r\nДата: 10/02/2275  \r\n\r\nУведомление для жителей и торговцев  \r\n\r\nВ связи с неожиданным перебазированием центрального офиса \"Малькор-Терминал\" сообщаем следующее:  \r\n\r\nПричины переезда:  \r\n-Расширение торговых операций – компания открывает новые склады в Нью-Рино и НКР  \r\n-Реконструкция Баззара – требует временного освобождения помещений  \r\n-Логистическая оптимизация – \"Малькор-Терминал\" подстраивается под новые маршруты караванов  \r\n\r\nЧто это значит для вас:  \r\n-Все действующие контракты остаются в силе  \r\n-Товары можно получать через местную лавку  \r\n-Охрана и защита караванов продолжают работать в прежнем режиме  \r\n\nБудущее Баззара: \r\n- Планируется открытие медицинского центра\r\n- Виктор Малькор остаётся владельцем земли и будет курировать развитие  "
