      content: "СЛЕДСТВЕННОЕ ДЕЛО №D-2274-09  \r  \r\n\"Для служебного пользования\"  \r\n\r\n1. Основные данные:  \r\n- ФИО должника: Карл \"Кривой\" Бреннер  \r\n- Род деятельности: Владелец лавки \"Ржавые гвозди\"  \r\n- Сумма долга: 547 крышек (основной долг + проценты)  \r\n- Срок просрочки: 47 дней  \r\n\r\n2. История долга:  \r\n- Дата займа: 15/07/2274  \r\n- Цель: \"Закупка партии инструментов\"  \r\n- Залог: Право на торговое место №3  \r\n- Последний платёж: 15/08/2274 (50 крышек)  \r\n\r\n3. Принятые меры:  \r\n1. Предупреждение №1 (через курьера): Игнорировано  \r\n2. Визит сборщиков долгов (20/08): Лавка оказалась пуста 3. Обнаружение: В лавке найден испорченный радиоприёмник (был настроен на 110.9 МГц)  \r\n\r\n4. Версии:  \r\n* Побег: Следы ведут к Уэндоверскому радиоактивному озеру  \r  \r\n* Несчастный случай: Возможная связь с \"инцидентом у колодца\" (см. дело №47)  \r\n\r\n5. Заключение:  \r\n- Торговое место №3 переходит Малькор-Терминал  \r\n- Долг списан в связи с исчезновением должника  \r\n- Дело передать в архив с пометкой \"Возобновить при появлении\"  \r\n\r\r\n[italic]Найти хоть тело. Мне нужен пример для других.[/italic]  "
