      content: "[head=3]ОФИЦИАЛЬНАЯ ИНСТРУКЦИЯ  \r\nк стимулирующему препарату  \r\n«МОРФИУС-Б»[head/]\n(шипучие таблетки для перорального применения)  \r\n\r\n** ОБЩИЕ СВЕДЕНИЯ **\n  \r\n-Форма выпуска: круглые шипучие таблетки голубого цвета с клеймом «MB-47»  \r\n-Упаковка: герметичный блистер по 10 шт.\n-Срок годности: 3 года  \r\n\r\r\n\n** СОСТАВ **  \r\n\n- Действующее вещество: модифицированный морфин-X (синтетический аналог с усиленной формулой)  \r\n- Дополнительные компоненты:  \r\n  - Ионный стабилизатор «NT-9»  \r\n  - Витаминный комплекс «Vita-Rad»   \r\n  - Ароматизатор «Апельсин-Клубничка»   \r\n\n\r\n**ПОКАЗАНИЯ К ПРИМЕНЕНИЮ**\n  \r\n✔ Экстренная стимуляция организма   \r\n✔ Подавление болевого синдрома\n✔ Временное повышение выносливости (до 12 часов)  \r\n\n\r\n**СПОСОБ ПРИМЕНЕНИЯ**\n  \r\n1. Растворите 1 таблетку в 100 мл чистой воды (желательно дистиллированной).  \r\n2. Дождитесь полного растворения (шипение должно прекратиться).  \r\n3. Выпейте залпом - эффект наступает через 3–5 минут.  \r\n\r\n⚠ Максимальная суточная доза: 2 таблетки (превышение ведёт к необратимым изменениям ЦНС).  \n\r\n\n**ПОБОЧНЫЕ ЭФФЕКТЫ** \n \r\n-Частые (40% случаев):  \r\n  - Головокружение  \r\n  - Повышенная потливость  \r\n  - Временная тремор конечностей\n  \r\n-Редкие (5% случаев):  \r\n  - Кратковременная потеря памяти  \r\n  - Галлюцинации (обычно слуховые)  \r\n  - Спонтанные мышечные спазмы  \r\n\r\n\n**ПРЕДУПРЕЖДЕНИЕ**\n  \r\n- Не совмещать с алкоголем, антирадиационными препаратами и пси-стимуляторами.  \r\n- Противопоказан при беременности, сердечной недостаточности и мутациях 3-й степени.  \r\n- Передозировка вызывает острую нейротоксическую реакцию.  \r\n\r\n\n** ХРАНЕНИЕ **\n  \r\n- Температура от +5°C до +25°C (избегать прямых солнечных лучей).  \r\n- Влажность не более 60%.  \r\n- Хранить в недоступном для детей месте\r\n\r\n\r\n** ПРИМЕЧАНИЕ: **  \n\r\n*«Морфиус-Б» не является полностью безопасным препаратом. При длительном применении вызывает привыкание. Рекомендуется использовать только в крайних случаях.*  \r\n\r \r\n«Для внутреннего пользования. Не подлежит свободной продаже.»"
