      content: "[head=3]# Секретный отчёт о шерифе-предателе # [head/]\n \r\nЕго превосходительства Грязного Джека, мэра Баззара (и по совместительству главного барыги)  \r\n\r\nДата: Когда уже совсем припёрло  \r\nКому: Самому себе (потому что некому доверять, блять)  \r\n\r\nВ чём, собственно говоря проблема?\r\n \r\nЭтот крысой обоссанный шериф - Ржавый Билл – последнее время ходит мутный, как вода после промывки реактора. Шушукается с народом, смотрит на меня так, будто я уже вишу на фонаре.  \r\n\nПодозрительная херня, которую он творит:  \r\n* Собирает народ - то на \"сходку граждан\", то на \"обсуждение порядка\". Блядь, у нас тут порядок один - я говорю, что делать!  \r\n* Шепчется с караванщиками - то ли оружие просит, то ли водку. И то, и то плохо.  \r\n* Смотрит на верёвки - на рынке видел, как он верёвки щупал и ухмылялся. КОНЕЧНО ЖЕ, СОВПАДЕНИЕ.  \r\n\nНарод и так недоволен - то воды нет, то крысы сожрали последнюю тушёнку. А теперь ещё этот усатый мудень хочет сделать из меня козла отпущения!  \r\n \r\nНадо быстро что-то решать, пока этот бунтовщик не собрал толпу и не принёс свой чёртов фонарный столб. "
